import { useState } from 'react'

const Header = (props) => {
  return (
    <h1>{props.course}</h1>
  )
}

const Part = (props) => {
  return (
    <p>{props.part} {props.exercises}</p>
  )
}

const Statistics = (props) => {
  return (
    <div></div>
  )
}

const Tab = (props) => {
  return (
  //<div>
    <tr>
      <td>good</td>
      <td>{props.good}</td>
    </tr>
    /*<tr>
      <td>neutral</td>
      <td>{props.neutral}</td>
    </tr>
    <tr>
      <td>bad</td>
      <td>{props.bad}</td>
    </tr>
    <tr>
      <td>all</td>
      <td>{props.bad + props.good + props.neutral}</td>
    </tr>*/
 // </div>
  )
}

const Button = (props) => {
  return (
    <button onClick={props.eventhandle}>{props.text}</button>
  )
}

const App = () => {
  const [good, setGood] = useState(0);
  const [neutral, setNeutral] = useState(0);
  const [bad, setBad] = useState(0);

  return (
    <div>
      <div>
        <Header course='Give feedback' />
        <Button eventhandle={ () => setGood(good + 1) } text='good'/>
        <Button eventhandle={ () => setNeutral(neutral + 1) } text='neutral'/>
        <Button eventhandle={ () => setBad(bad + 1) } text='bad'/>
      </div>
        <Header course='Statistics'/>
        <Tab good={good}/>
    </div>
  )
}

export default App
